const config = {
  "previewFeatures": [],
  "clientVersion": "7.3.0",
  "engineVersion": "9d6ad21cbbceab97458517b147a6a09ff43aa735",
  "activeProvider": "postgresql",
  "inlineSchema": "// ───────────────────────────────────────────────────────────────\n// Urban Classes — Course Selling Platform\n// Prisma Schema (PostgreSQL)\n// ───────────────────────────────────────────────────────────────\n\ngenerator client {\n  provider = \"prisma-client-js\"\n  output   = \"../generated/prisma\"\n}\n\ndatasource db {\n  provider = \"postgresql\"\n}\n\n// ═══════════════════════════════════════════════════════════════\n//  ENUMS\n// ═══════════════════════════════════════════════════════════════\n\nenum Role {\n  STUDENT\n  INSTRUCTOR\n  ADMIN\n}\n\nenum CourseLevel {\n  BEGINNER\n  INTERMEDIATE\n  ADVANCED\n  ALL_LEVELS\n}\n\nenum CourseStatus {\n  DRAFT\n  UNDER_REVIEW\n  PUBLISHED\n  ARCHIVED\n}\n\nenum LessonType {\n  VIDEO\n  PDF\n  QUIZ\n  TEXT\n  LIVE\n}\n\nenum OrderStatus {\n  PENDING\n  COMPLETED\n  FAILED\n  REFUNDED\n}\n\nenum DiscountType {\n  PERCENTAGE\n  FIXED\n}\n\nenum EnrollmentStatus {\n  ACTIVE\n  EXPIRED\n  COMPLETED\n  CANCELLED\n}\n\n// ═══════════════════════════════════════════════════════════════\n//  1. AUTHENTICATION & USERS\n// ═══════════════════════════════════════════════════════════════\n\nmodel Account {\n  id        String   @id @default(cuid())\n  role      Role     @default(STUDENT)\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  // Profile Relations (1:1)\n  student    User?\n  instructor Instructor?\n  admin      Admin?\n\n  @@index([role])\n  @@map(\"roles\")\n}\n\nmodel User {\n  id     String  @id @default(cuid())\n  name   String?\n  email  String  @unique\n  phone  String? @unique\n  avatar Json? // { url, publicId, ... }\n\n  isVerified Boolean @default(false)\n  isBlocked  Boolean @default(false)\n\n  accountId String  @unique\n  account   Account @relation(fields: [accountId], references: [id], onDelete: Cascade)\n\n  // Relations (Student specific)\n  goals          UserGoal[]\n  enrollments    Enrollment[]\n  orders         Order[]\n  reviews        Review[]\n  lessonProgress LessonProgress[]\n  wishlist       Wishlist[]\n  personalInfo   PersonalInformation?\n\n  @@map(\"users\")\n}\n\nmodel PersonalInformation {\n  id      String    @id @default(cuid())\n  gender  String?\n  dob     DateTime?\n  address String?\n  city    String?\n  state   String?\n  pincode String?\n  country String    @default(\"India\")\n\n  userId String @unique\n  user   User   @relation(fields: [userId], references: [id], onDelete: Cascade)\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  @@map(\"personal_information\")\n}\n\nmodel Instructor {\n  id String @id @default(cuid())\n\n  name   String?\n  email  String  @unique\n  phone  String? @unique\n  avatar Json? // { url, publicId, ... }\n\n  isVerified Boolean @default(false)\n  isBlocked  Boolean @default(false)\n\n  accountId String  @unique\n  account   Account @relation(fields: [accountId], references: [id], onDelete: Cascade)\n\n  bio            String?\n  specialization String?\n  experience     Int?\n  rating         Float   @default(0)\n\n  // Relations (Teaching)\n  courses CourseInstructor[]\n\n  @@map(\"instructors\")\n}\n\nmodel Admin {\n  id       String @id @default(cuid())\n  name     String\n  email    String @unique\n  password String\n\n  accountId String  @unique\n  account   Account @relation(fields: [accountId], references: [id], onDelete: Cascade)\n\n  @@map(\"admins\")\n}\n\nmodel Otp {\n  id        String   @id @default(cuid())\n  email     String\n  otp       String\n  expiresAt DateTime\n  verified  Boolean  @default(false)\n  createdAt DateTime @default(now())\n\n  @@index([email, verified])\n  @@map(\"otps\")\n}\n\n// ═══════════════════════════════════════════════════════════════\n//  2. COURSE TAXONOMY (Categories & Goals)\n// ═══════════════════════════════════════════════════════════════\n\nmodel Category {\n  id          String   @id @default(cuid())\n  name        String   @unique\n  slug        String   @unique\n  description String?\n  icon        Json? // { url, publicId, ... }\n  order       Int      @default(0)\n  isActive    Boolean  @default(true)\n  createdAt   DateTime @default(now())\n  updatedAt   DateTime @updatedAt\n\n  // Relations\n  subCategories SubCategory[]\n  results       Result[]\n\n  @@map(\"categories\")\n}\n\nmodel SubCategory {\n  id          String   @id @default(cuid())\n  name        String\n  slug        String   @unique\n  description String?\n  icon        Json? // { url, publicId, ... }\n  order       Int      @default(0)\n  isActive    Boolean  @default(true)\n  createdAt   DateTime @default(now())\n  updatedAt   DateTime @updatedAt\n\n  // Relations\n  categoryId String\n  category   Category   @relation(fields: [categoryId], references: [id], onDelete: Cascade)\n  courses    Course[]\n  userGoals  UserGoal[]\n\n  @@index([categoryId])\n  @@map(\"sub_categories\")\n}\n\nmodel UserGoal {\n  id        String   @id @default(cuid())\n  createdAt DateTime @default(now())\n\n  // Relations\n  userId        String\n  user          User        @relation(fields: [userId], references: [id], onDelete: Cascade)\n  subCategoryId String\n  subCategory   SubCategory @relation(fields: [subCategoryId], references: [id], onDelete: Cascade)\n\n  @@unique([userId, subCategoryId])\n  @@index([userId])\n  @@index([subCategoryId])\n  @@map(\"user_goals\")\n}\n\n// ═══════════════════════════════════════════════════════════════\n//  3. COURSES & CONTENT\n//     Hierarchy: Course → Subject → Section → Lesson\n// ═══════════════════════════════════════════════════════════════\n\nmodel Course {\n  id               String       @id @default(cuid())\n  title            String\n  slug             String       @unique\n  shortDescription String?\n  description      String?      @db.Text\n  thumbnail        Json? // { url, publicId, ... }\n  previewVideo     Json? // { url, publicId, duration, ... }\n  price            Float        @default(0)\n  discountPrice    Float?\n  language         String       @default(\"Hindi\")\n  level            CourseLevel  @default(ALL_LEVELS)\n  status           CourseStatus @default(DRAFT)\n  isFeatured       Boolean      @default(false)\n  durationMonths   Int          @default(0) // course validity in months\n  totalLessons     Int          @default(0)\n  metaTitle        String?\n  metaDescription  String?\n  createdAt        DateTime     @default(now())\n  updatedAt        DateTime     @updatedAt\n\n  // Relations\n  subCategoryId String\n  subCategory   SubCategory        @relation(fields: [subCategoryId], references: [id], onDelete: Cascade)\n  instructors   CourseInstructor[]\n  subjects      Subject[]\n  tags          CourseTag[]\n  enrollments   Enrollment[]\n  orders        Order[]\n  reviews       Review[]\n  wishlist      Wishlist[]\n\n  @@index([subCategoryId])\n  @@index([status])\n  @@index([isFeatured])\n  @@index([createdAt])\n  @@map(\"courses\")\n}\n\n// ─── Many-to-Many: Course ↔ Instructor ─────────────────────────\n\nmodel CourseInstructor {\n  id        String   @id @default(cuid())\n  role      String   @default(\"instructor\") // instructor / co-instructor / ta\n  order     Int      @default(0)\n  createdAt DateTime @default(now())\n\n  // Relations\n  courseId     String\n  course       Course     @relation(fields: [courseId], references: [id], onDelete: Cascade)\n  instructorId String\n  instructor   Instructor @relation(fields: [instructorId], references: [id], onDelete: Cascade)\n\n  @@unique([courseId, instructorId])\n  @@index([instructorId])\n  @@map(\"course_instructors\")\n}\n\n// ─── Subject (inside a Course) ──────────────────────────────────\n\nmodel Subject {\n  id          String   @id @default(cuid())\n  title       String\n  description String?\n  icon        Json? // { url, publicId, ... }\n  order       Int      @default(0)\n  createdAt   DateTime @default(now())\n  updatedAt   DateTime @updatedAt\n\n  // Relations\n  courseId String\n  course   Course    @relation(fields: [courseId], references: [id], onDelete: Cascade)\n  sections Section[]\n\n  @@index([courseId])\n  @@map(\"subjects\")\n}\n\n// ─── Section (inside a Subject) ────────────────────────────────\n\nmodel Section {\n  id        String   @id @default(cuid())\n  title     String\n  order     Int      @default(0)\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  // Relations\n  subjectId String\n  subject   Subject  @relation(fields: [subjectId], references: [id], onDelete: Cascade)\n  lessons   Lesson[]\n\n  @@index([subjectId])\n  @@map(\"sections\")\n}\n\n// ─── Lesson (inside a Section) ─────────────────────────────────\n\nmodel Lesson {\n  id          String     @id @default(cuid())\n  title       String\n  description String?\n  type        LessonType @default(VIDEO)\n  content     String?    @db.Text // rich text / markdown for TEXT type\n  video       Json? // { url, publicId, duration, quality, ... }\n  attachments Json? // [{ url, publicId, name, type, size }]\n  duration    Int        @default(0) // in seconds\n  order       Int        @default(0)\n  isFree      Boolean    @default(false)\n  createdAt   DateTime   @default(now())\n  updatedAt   DateTime   @updatedAt\n\n  // Relations\n  sectionId       String\n  section         Section          @relation(fields: [sectionId], references: [id], onDelete: Cascade)\n  progress        LessonProgress[]\n  lessonResources LessonResource[]\n\n  @@index([sectionId])\n  @@map(\"lessons\")\n}\n\nmodel LessonResource {\n  id        String   @id @default(cuid())\n  title     String\n  file      Json // { url, publicId, fileName, size, mimeType }\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n  // Relations\n  lessonId  String\n  lesson    Lesson   @relation(fields: [lessonId], references: [id], onDelete: Cascade)\n\n  @@index([lessonId])\n  @@map(\"lesson_resources\")\n}\n\n// ─── Course Tags ────────────────────────────────────────────────\n\nmodel CourseTag {\n  id   String @id @default(cuid())\n  name String\n\n  // Relations\n  courseId String\n  course   Course @relation(fields: [courseId], references: [id], onDelete: Cascade)\n\n  @@unique([courseId, name])\n  @@index([name])\n  @@map(\"course_tags\")\n}\n\n// ═══════════════════════════════════════════════════════════════\n//  4. PURCHASES & PAYMENTS\n// ═══════════════════════════════════════════════════════════════\n\nmodel Order {\n  id            String      @id @default(cuid())\n  orderNumber   String      @unique @default(cuid())\n  amount        Float\n  discount      Float       @default(0)\n  tax           Float       @default(0)\n  totalAmount   Float\n  status        OrderStatus @default(PENDING)\n  paymentId     String? // Razorpay / Stripe payment ID\n  paymentMethod String?\n  couponCode    String?\n  receipt       Json? // { invoiceUrl, details, ... }\n  createdAt     DateTime    @default(now())\n  updatedAt     DateTime    @updatedAt\n\n  // Relations\n  userId   String\n  user     User   @relation(fields: [userId], references: [id], onDelete: Cascade)\n  courseId String\n  course   Course @relation(fields: [courseId], references: [id], onDelete: Cascade)\n\n  @@index([userId])\n  @@index([courseId])\n  @@index([status])\n  @@index([orderNumber])\n  @@index([createdAt])\n  @@map(\"orders\")\n}\n\nmodel Enrollment {\n  id          String           @id @default(cuid())\n  status      EnrollmentStatus @default(ACTIVE)\n  progress    Float            @default(0) // overall % (0–100)\n  enrolledAt  DateTime         @default(now())\n  expiresAt   DateTime?\n  completedAt DateTime?\n\n  // Relations\n  userId   String\n  user     User   @relation(fields: [userId], references: [id], onDelete: Cascade)\n  courseId String\n  course   Course @relation(fields: [courseId], references: [id], onDelete: Cascade)\n\n  @@unique([userId, courseId])\n  @@index([userId])\n  @@index([status])\n  @@map(\"enrollments\")\n}\n\n// ═══════════════════════════════════════════════════════════════\n//  5. LESSON PROGRESS (self-marked completion)\n// ═══════════════════════════════════════════════════════════════\n\nmodel LessonProgress {\n  id          String    @id @default(cuid())\n  isCompleted Boolean   @default(false) // user marks this themselves\n  completedAt DateTime?\n  createdAt   DateTime  @default(now())\n  updatedAt   DateTime  @updatedAt\n\n  // Relations\n  userId   String\n  user     User   @relation(fields: [userId], references: [id], onDelete: Cascade)\n  lessonId String\n  lesson   Lesson @relation(fields: [lessonId], references: [id], onDelete: Cascade)\n\n  @@unique([userId, lessonId])\n  @@index([userId])\n  @@map(\"lesson_progress\")\n}\n\n// ═══════════════════════════════════════════════════════════════\n//  6. REVIEWS & RATINGS\n// ═══════════════════════════════════════════════════════════════\n\nmodel Review {\n  id        String   @id @default(cuid())\n  rating    Int // 1 to 5\n  comment   String?  @db.Text\n  isVisible Boolean  @default(true)\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  // Relations\n  userId   String\n  user     User   @relation(fields: [userId], references: [id], onDelete: Cascade)\n  courseId String\n  course   Course @relation(fields: [courseId], references: [id], onDelete: Cascade)\n\n  @@unique([userId, courseId])\n  @@map(\"reviews\")\n}\n\n// ═══════════════════════════════════════════════════════════════\n//  7. WISHLIST & CART\n// ═══════════════════════════════════════════════════════════════\n\nmodel Wishlist {\n  id        String   @id @default(cuid())\n  createdAt DateTime @default(now())\n\n  // Relations\n  userId   String\n  user     User   @relation(fields: [userId], references: [id], onDelete: Cascade)\n  courseId String\n  course   Course @relation(fields: [courseId], references: [id], onDelete: Cascade)\n\n  @@unique([userId, courseId])\n  @@map(\"wishlists\")\n}\n\n// ═══════════════════════════════════════════════════════════════\n//  8. BANNERS & PROMOTIONS\n// ═══════════════════════════════════════════════════════════════\n\nmodel Banner {\n  id        String   @id @default(cuid())\n  title     String\n  image     Json // { url, publicId, ... }\n  link      String?\n  isActive  Boolean  @default(true)\n  order     Int      @default(0)\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  @@map(\"banners\")\n}\n\nmodel Coupon {\n  id             String       @id @default(cuid())\n  code           String       @unique\n  description    String?\n  discountType   DiscountType\n  discountValue  Float\n  minOrderAmount Float?\n  maxUses        Int?\n  usedCount      Int          @default(0)\n  validFrom      DateTime\n  validTill      DateTime\n  isActive       Boolean      @default(true)\n  createdAt      DateTime     @default(now())\n  updatedAt      DateTime     @updatedAt\n\n  @@index([code, isActive])\n  @@map(\"coupons\")\n}\n\nmodel Result {\n  id          String  @id @default(cuid())\n  studentName String\n  rank        String\n  examName    String\n  year        Int\n  image       Json? // { url, publicId }\n  college     String?\n  quote       String? @db.Text\n  isFeatured  Boolean @default(false)\n\n  // Relations\n  categoryId String?\n  category   Category? @relation(fields: [categoryId], references: [id], onDelete: SetNull)\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  @@map(\"results\")\n}\n\n// ═══════════════════════════════════════════════════════════════\n//  9. OFFLINE CENTERS\n// ═══════════════════════════════════════════════════════════════\n\nmodel OfflineCenter {\n  id          String  @id @default(cuid())\n  name        String\n  city        String\n  address     String  @db.Text\n  phone       String?\n  email       String?\n  image       Json? // { url, publicId }\n  locationUrl String? // Google Maps link\n  isActive    Boolean @default(true)\n  order       Int     @default(0)\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  @@index([city])\n  @@index([isActive])\n  @@map(\"offline_centers\")\n}\n\n// ═══════════════════════════════════════════════════════════════\n//  10. BLOGS\n// ═══════════════════════════════════════════════════════════════\n\nmodel Blog {\n  id          String    @id @default(cuid())\n  title       String\n  slug        String    @unique\n  content     String    @db.Text\n  excerpt     String?   @db.Text\n  thumbnail   Json? // { url, publicId }\n  category    String?\n  tags        String[]  @default([])\n  isPublished Boolean   @default(false)\n  publishedAt DateTime?\n  authorName  String?\n  authorImage Json? // { url, publicId }\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  @@index([slug])\n  @@index([isPublished])\n  @@map(\"blogs\")\n}\n"
}

